INSERT INTO `base_geoindicator` (`id`, `code`, `name`, `geo_type`, `value_type`, `base_period`, `description`, `periodicity`, `status`, `aggregation_method`) VALUES
(1, 'AG.AGR.TRAC.NO', 'Agricultural machinery, tractors', 'Country', '', '', 'Agricultural machinery refers to the number of wheel and crawler tractors (excluding garden tractors) in use in agriculture at the end of the calendar year specified or during the first quarter of the following year.', 'Annual', '', 'Sum'),
(2, 'AG.CON.FERT.PT.ZS', 'Fertilizer consumption (% of fertilizer production)', 'Country', '', '', 'Fertilizer consumption measures the quantity of plant nutrients used per unit of arable land. Fertilizer products cover nitrogenous, potash, and phosphate fertilizers (including ground rock phosphate). Traditional nutrientsanimal and plant manuresare not ', 'Annual', '', 'Weighted average'),
(3, 'AG.CON.FERT.ZS', 'Fertilizer consumption (kilograms per hectare of arable land)', 'Country', '', '', 'Fertilizer consumption measures the quantity of plant nutrients used per unit of arable land. Fertilizer products cover nitrogenous, potash, and phosphate fertilizers (including ground rock phosphate). Traditional nutrientsanimal and plant manuresare not ', 'Annual', '', 'Weighted average'),
(4, 'AG.LND.AGRI.K2', 'Agricultural land (sq. km)', 'Country', '', '', 'Agricultural land refers to the share of land area that is arable, under permanent crops, and under permanent pastures. Arable land includes land defined by the FAO as land under temporary crops (doublecropped areas are counted once), temporary meadows fo', 'Annual', '', 'Sum'),
(5, 'AG.LND.AGRI.ZS', 'Agricultural land (% of land area)', 'Country', '', '', 'Agricultural land refers to the share of land area that is arable, under permanent crops, and under permanent pastures. Arable land includes land defined by the FAO as land under temporary crops (doublecropped areas are counted once), temporary meadows fo', 'Annual', '', 'Weighted average'),
(6, 'AG.LND.ARBL.HA', 'Arable land (hectares)', 'Country', '', '', 'Arable land (in hectares) includes land defined by the FAO as land under temporary crops (doublecropped areas are counted once), temporary meadows for mowing or for pasture, land under market or kitchen gardens, and land temporarily fallow. Land abandoned', 'Annual', '', ''),
(7, 'AG.LND.ARBL.HA.PC', 'Arable land (hectares per person)', 'Country', '', '', 'Arable land (hectares per person) includes land defined by the FAO as land under temporary crops (doublecropped areas are counted once), temporary meadows for mowing or for pasture, land under market or kitchen gardens, and land temporarily fallow. Land a', 'Annual', '', 'Weighted average'),
(8, 'AG.LND.ARBL.ZS', 'Arable land (% of land area)', 'Country', '', '', 'Arable land includes land defined by the FAO as land under temporary crops (doublecropped areas are counted once), temporary meadows for mowing or for pasture, land under market or kitchen gardens, and land temporarily fallow. Land abandoned as a result o', 'Annual', '', 'Weighted average'),
(9, 'AG.LND.CREL.HA', 'Land under cereal production (hectares)', 'Country', '', '', 'Land under cereal production refers to harvested area, although some countries report only sown or cultivated area. Cereals include wheat, rice, maize, barley, oats, rye, millet, sorghum, buckwheat, and mixed grains. Production data on cereals relate to c', 'Annual', '', 'Sum'),
(10, 'AG.LND.CROP.ZS', 'Permanent cropland (% of land area)', 'Country', '', '', 'Permanent cropland is land cultivated with crops that occupy the land for long periods and need not be replanted after each harvest, such as cocoa, coffee, and rubber. This category includes land under flowering shrubs, fruit trees, nut trees, and vines, ', 'Annual', '', 'Weighted average'),
(11, 'AG.LND.EL5M.ZS', 'Land area where elevation is below 5 meters (% of total land area)', 'Country', '', '', 'Land area below 5m is the percentage of total land where the elevation is 5 meters or less.', 'Annual', '', 'Weighted average'),
(12, 'AG.LND.FRST.K2', 'Forest area (sq. km)', 'Country', '', '', 'Forest area is land under natural or planted stands of trees of at least 5 meters in situ, whether productive or not, and excludes tree stands in agricultural production systems (for example, in fruit plantations and agroforestry systems) and trees in urb', 'Annual', '', 'Sum'),
(13, 'AG.LND.FRST.ZS', 'Forest area (% of land area)', 'Country', '', '', 'Forest area is land under natural or planted stands of trees of at least 5 meters in situ, whether productive or not, and excludes tree stands in agricultural production systems (for example, in fruit plantations and agroforestry systems) and trees in urb', 'Annual', '', 'Weighted average'),
(14, 'AG.LND.IRIG.AG.ZS', 'Agricultural irrigated land (% of total agricultural land)', 'Country', '', '', 'Agricultural irrigated land refers to agricultural areas purposely provided with water, including land irrigated by controlled flooding.', 'Annual', '', 'Weighted average'),
(15, 'AG.LND.PRCP.MM', 'Average precipitation in depth (mm per year)', 'Country', '', '', 'Average precipitation is the longterm average in depth (over space and time) of annual precipitation in the country. Precipitation is defined as any kind of water that falls from clouds as a liquid or a solid.', 'Annual', '', ''),
(16, 'AG.LND.TOTL.K2', 'Land area (sq. km)', 'Country', '', '', 'Land area is a country''s total area, excluding area under inland water bodies, national claims to continental shelf, and exclusive economic zones. In most cases the definition of inland water bodies includes major rivers and lakes.', 'Annual', '', 'Sum'),
(17, 'AG.LND.TRAC.ZS', 'Agricultural machinery, tractors per 100 sq. km of arable land', 'Country', '', '', 'Agricultural machinery refers to the number of wheel and crawler tractors (excluding garden tractors) in use in agriculture at the end of the calendar year specified or during the first quarter of the following year. Arable land includes land defined by t', 'Annual', '', 'Weighted average'),
(18, 'AG.PRD.CREL.MT', 'Cereal production (metric tons)', 'Country', '', '', 'Production data on cereals relate to crops harvested for dry grain only. Cereal crops harvested for hay or harvested green for food, feed, or silage and those used for grazing are excluded.', 'Annual', '', ''),
(19, 'AG.PRD.CROP.XD', 'Crop production index (20042006 = 100)', 'Country', '', '200406', 'Crop production index shows agricultural production for each year relative to the base period 20042006. It includes all crops except fodder crops. Regional and income group aggregates for the FAO''s production indexes are calculated from the underlying val', 'Annual', '', 'Weighted average'),
(20, 'AG.PRD.FOOD.XD', 'Food production index (20042006 = 100)', 'Country', '', '200406', 'Food production index covers food crops that are considered edible and that contain nutrients. Coffee and tea are excluded because, although edible, they have no nutritive value.', 'Annual', '', 'Weighted average'),
(21, 'AG.PRD.LVSK.XD', 'Livestock production index (20042006 = 100)', 'Country', '', '200406', 'Livestock production index includes meat and milk from all sources, dairy products such as cheese, and eggs, honey, raw silk, wool, and hides and skins.', 'Annual', '', 'Weighted average'),
(22, 'AG.SRF.TOTL.K2', 'Surface area (sq. km)', 'Country', '', '', 'Surface area is a country''s total area, including areas under inland bodies of water and some coastal waterways.', 'Annual', '', 'Sum'),
(23, 'AG.YLD.CREL.KG', 'Cereal yield (kg per hectare)', 'Country', '', '', 'Cereal yield, measured as kilograms per hectare of harvested land, includes wheat, rice, maize, barley, oats, rye, millet, sorghum, buckwheat, and mixed grains. Production data on cereals relate to crops harvested for dry grain only. Cereal crops harveste', 'Annual', '', 'Weighted average'),
(24, 'BG.GSR.NFSV.GD.ZS', 'Trade in services (% of GDP)', 'Country', '', '', 'Trade in services is the sum of service exports and imports divided by the value of GDP, all in current U.S. dollars.', 'Annual', '', 'Weighted average'),
(25, 'BM.GSR.CMCP.ZS', 'Communications, computer, etc. (% of service imports, BoP)', 'Country', '', '', 'Communications, computer, information, and other services (% of service imports, BoP) cover international telecommunications and postal and courier services; computer data; newsrelated service transactions between residents and nonresidents; construction ', 'Annual', '', 'Weighted average'),
(26, 'BM.GSR.FCTY.CD', 'Income payments (BoP, current US$)', 'Country', '', '', 'Income payments refer to employee compensation paid to nonresident workers and investment income (payments on direct investment, portfolio investment, other investments). Income derived from the use of intangible assets is excluded from income and recorde', 'Annual', '', 'Sum'),
(27, 'BM.GSR.GNFS.CD', 'Imports of goods and services (BoP, current US$)', 'Country', '', '', 'Imports of goods and services comprise all transactions between residents of a country and the rest of the world involving a change of ownership from nonresidents to residents of general merchandise, goods sent for processing and repairs, nonmonetary gold', 'Annual', '', 'Gapfilled total'),
(28, 'BM.GSR.INSF.ZS', 'Insurance and financial services (% of service imports, BoP)', 'Country', '', '', 'Insurance and financial services (% of service imports, BoP) cover various types of insurance provided to nonresidents by resident insurance enterprises and vice versa, and financial intermediary and auxiliary services (except those of insurance enterpris', 'Annual', '', 'Weighted average'),
(29, 'BM.GSR.MRCH.CD', 'Goods imports (BoP, current US$)', 'Country', '', '', 'Goods imports refer to all movable goods (including nonmonetary gold) involved in a change of ownership from nonresidents to residents. The category includes goods previously included in services: goods received or sent for processing and their subsequent', 'Annual', '', 'Gapfilled total'),
(30, 'BM.GSR.NFSV.CD', 'Service imports (BoP, current US$)', 'Country', '', '', 'Services (previously nonfactor services) refer to economic output of intangible commodities that may be produced, transferred, and consumed at the same time. International transactions in services are defined by the IMF''s Balance of Payments Manual (1993)', 'Annual', '', 'Gapfilled total'),
(31, 'BM.GSR.ROYL.CD', 'Royalty and license fees, payments (BoP, current US$)', 'Country', '', '', 'Royalty and license fees are payments and receipts between residents and nonresidents for the authorized use of intangible, nonproduced, nonfinancial assets and proprietary rights (such as patents, copyrights, trademarks, industrial processes, and franchi', 'Annual', '', 'Sum'),
(32, 'BM.GSR.TOTL.CD', 'Imports of goods, services and income (BoP, current US$)', 'Country', '', '', 'Imports of goods, services and income is the sum of goods (merchandise) imports, imports of (nonfactor) services and income (factor) payments. Data are in current U.S. dollars.', 'Annual', '', 'Gapfilled total'),
(33, 'BM.GSR.TRAN.ZS', 'Transport services (% of service imports, BoP)', 'Country', '', '', 'Transport (% of service imports, BoP) covers all transport services (sea, air, land, internal waterway, space, and pipeline) performed by residents of one economy for those of another and involving the carriage of passengers, the movement of goods (freigh', 'Annual', '', 'Weighted average'),
(34, 'BM.GSR.TRVL.ZS', 'Travel services (% of service imports, BoP)', 'Country', '', '', 'Travel (% of service imports, BoP) covers goods and services acquired from an economy by travelers for their own use during visits of less than one year in that economy for either business or personal purposes. Services imports refer to economic output of', 'Annual', '', 'Weighted average'),
(35, 'BM.KLT.DINV.GD.ZS', 'Foreign direct investment, net outflows (% of GDP)', 'Country', '', '', 'Foreign direct investment are the net inflows of investment to acquire a lasting management interest (10 percent or more of voting stock) in an enterprise operating in an economy other than that of the investor. It is the sum of equity capital, reinvestme', 'Annual', '', 'Weighted average'),
(36, 'BM.TRF.PRVT.CD', 'Private current transfers, payments (BoP, current US$)', 'Country', '', '', 'Current transfers are recorded in the balance of payments whenever an economy provides or receives goods, services, income, or financial items without a quid pro quo. All transfers not considered to be capital are current. Data are in current U.S. dollars', 'Annual', '', 'Sum'),
(37, 'BM.TRF.PWKR.CD.DT', 'Personal transfers and compensation of employees, paid (current US$)', 'Country', '', '', 'Personal transfers consist of all current transfers in cash or in kind made or received by resident households to or from nonresident households. Personal transfers thus include all current transfers between resident and nonresident individuals. Compensat', 'Annual', '', 'Sum'),
(38, 'BN.CAB.XOKA.CD', 'Current account balance (BoP, current US$)', 'Country', '', '', 'Current account balance is the sum of net exports of goods, services, net income, and net current transfers. Data are in current U.S. dollars.', 'Annual', '', 'Sum'),
(39, 'BN.CAB.XOKA.GD.ZS', 'Current account balance (% of GDP)', 'Country', '', '', 'Current account balance is the sum of net exports of goods, services, net income, and net current transfers.', 'Annual', '', ''),
(40, 'BN.GSR.FCTY.CD', 'Net income (BoP, current US$)', 'Country', '', '', 'Net income refers to receipts and payments of employee compensation paid to nonresident workers and investment income (receipts and payments on direct investment, portfolio investment, other investments, and receipts on reserve assets). Income derived fro', 'Annual', '', ''),
(41, 'BN.GSR.GNFS.CD', 'Net trade in goods and services (BoP, current US$)', 'Country', '', '', 'Net trade in goods and services is derived by offsetting imports of goods and services against exports of goods and services. Exports and imports of goods and services comprise all transactions involving a change of ownership of goods and services between', 'Annual', '', ''),
(42, 'BN.GSR.MRCH.CD', 'Net trade in goods (BoP, current US$)', 'Country', '', '', 'Net trade in goods is the difference between exports and imports of goods. The category includes goods previously included in services: goods received or sent for processing and their subsequent export or import in the form of processed goods, repairs on ', 'Annual', '', ''),
(43, 'BN.KAC.EOMS.CD', 'Net errors and omissions, adjusted (BoP, current US$)', 'Country', '', '', 'Net errors and omissions constitute a residual category needed to ensure that all debit and credit entries in the balance of payments statement sum to zero. In the International Financial Statistics presentation, this is equal to the difference between re', 'Annual', '', 'Sum'),
(44, 'BN.KLT.DINV.CD', 'Foreign direct investment, net (BoP, current US$)', 'Country', '', '', 'Foreign direct investment is net inflows of investment to acquire a lasting management interest (10 percent or more of voting stock) in an enterprise operating in an economy other than that of the investor. It is the sum of equity capital, reinvestment of', 'Annual', '', 'Sum'),
(45, 'BN.KLT.PRVT.CD', 'Private capital flows, total (BoP, current US$)', 'Country', '', '', 'Private capital flows consist of net foreign direct investment and portfolio investment. Foreign direct investment is net inflows of investment to acquire a lasting management interest (10 percent or more of voting stock) in an enterprise operating in an ', 'Annual', '', 'Sum'),
(46, 'BN.KLT.PRVT.GD.ZS', 'Private capital flows, total (% of GDP)', 'Country', '', '', 'Private capital flows consist of net foreign direct investment and portfolio investment. Foreign direct investment is net inflows of investment to acquire a lasting management interest (10 percent or more of voting stock) in an enterprise operating in an ', 'Annual', '', ''),
(47, 'BN.KLT.PTXL.CD', 'Portfolio investment, excluding LCFAR (BoP, current US$)', 'Country', '', '', 'Portfolio investment excluding liabilities constituting foreign authorities'' reserves covers transactions in equity securities and debt securities. Data are in current U.S. dollars.', 'Annual', '', 'Sum'),
(48, 'BN.RES.INCL.CD', 'Changes in net reserves (BoP, current US$)', 'Country', '', '', 'Changes in net reserves is the net change in a country''s holdings of international reserves resulting from transactions on the current, capital, and financial accounts. These include changes in holdings of monetary gold, SDRs, foreign exchange assets, res', 'Annual', '', 'Sum'),
(49, 'BN.TRF.CURR.CD', 'Net current transfers (BoP, current US$)', 'Country', '', '', 'Net current transfers are recorded in the balance of payments whenever an economy provides or receives goods, services, income, or financial items without a quid pro quo. All transfers not considered to be capital are current. Data are in current U.S. dol', 'Annual', '', ''),
(50, 'BN.TRF.KOGT.CD', 'Net capital account (BoP, current US$)', 'Country', '', '', 'Net capital account includes government debt forgiveness, investment grants in cash or in kind by a government entity, and taxes on capital transfers. Also included are migrants'' capital transfers and debt forgiveness and investment grants by nongovernmen', 'Annual', '', 'Sum'),
(51, 'BX.GRT.EXTA.CD.WD', 'Grants, excluding technical cooperation (BoP, current US$)', 'Country', '', '', 'Grants are defined as legally binding commitments that obligate a specific value of funds available for disbursement for which there is no repayment requirement. Data are in current U.S. dollars.', 'Annual', '', 'Sum'),
(52, 'BX.GRT.TECH.CD.WD', 'Technical cooperation grants (BoP, current US$)', 'Country', '', '', 'Technical cooperation grants include freestanding technical cooperation grants, which are intended to finance the transfer of technical and managerial skills or of technology for the purpose of building up general national capacity without reference to an', 'Annual', '', 'Sum'),
(53, 'BX.GSR.CCIS.CD', 'ICT service exports (BoP, current US$)', 'Country', '', '', 'Information and communication technology service exports include computer and communications services (telecommunications and postal and courier services) and information services (computer data and newsrelated service transactions).', 'Annual', '', 'Sum'),
(54, 'BX.GSR.CCIS.ZS', 'ICT service exports (% of service exports, BoP)', 'Country', '', '', 'Information and communication technology service exports include computer and communications services (telecommunications and postal and courier services) and information services (computer data and newsrelated service transactions).', 'Annual', '', 'Weighted average'),
(55, 'BX.GSR.CMCP.ZS', 'Communications, computer, etc. (% of service exports, BoP)', 'Country', '', '', 'Communications, computer, information, and other services (% of service exports, BoP) cover international telecommunications and postal and courier services; computer data; newsrelated service transactions between residents and nonresidents; construction ', 'Annual', '', 'Weighted average'),
(56, 'BX.GSR.FCTY.CD', 'Income receipts (BoP, current US$)', 'Country', '', '', 'Income receipts refer to employee compensation paid to resident workers working abroad and investment income (receipts on direct investment, portfolio investment, other investments, and receipts on reserve assets). Income derived from the use of intangibl', 'Annual', '', 'Sum'),
(57, 'BX.GSR.GNFS.CD', 'Exports of goods and services (BoP, current US$)', 'Country', '', '', 'Exports of goods and services comprise all transactions between residents of a country and the rest of the world involving a change of ownership from residents to nonresidents of general merchandise, goods sent for processing and repairs, nonmonetary gold', 'Annual', '', 'Gapfilled total'),
(58, 'BX.GSR.INSF.ZS', 'Insurance and financial services (% of service exports, BoP)', 'Country', '', '', 'Insurance and financial services (% of service exports, BoP) cover various types of insurance provided to nonresidents by resident insurance enterprises and vice versa, and financial intermediary and auxiliary services (except those of insurance enterpris', 'Annual', '', 'Weighted average'),
(59, 'BX.GSR.MRCH.CD', 'Goods exports (BoP, current US$)', 'Country', '', '', 'Goods exports refer to all movable goods (including nonmonetary gold) involved in a change of ownership from residents to nonresidents. The category includes goods previously included in services: goods received or sent for processing and their subsequent', 'Annual', '', 'Gapfilled total'),
(60, 'BX.GSR.NFSV.CD', 'Service exports (BoP, current US$)', 'Country', '', '', 'Services (previously nonfactor services) refer to economic output of intangible commodities that may be produced, transferred, and consumed at the same time. International transactions in services are defined by the IMF''s Balance of Payments Manual (1993)', 'Annual', '', 'Gapfilled total'),
(61, 'BX.GSR.ROYL.CD', 'Royalty and license fees, receipts (BoP, current US$)', 'Country', '', '', 'Royalty and license fees are payments and receipts between residents and nonresidents for the authorized use of intangible, nonproduced, nonfinancial assets and proprietary rights (such as patents, copyrights, trademarks, industrial processes, and franchi', 'Annual', '', 'Sum'),
(62, 'BX.GSR.TOTL.CD', 'Exports of goods, services and income (BoP, current US$)', 'Country', '', '', 'Exports of goods, services and income is the sum of goods (merchandise) exports, exports of (nonfactor) services and income (factor) receipts. Data are in current U.S. dollars.', 'Annual', '', 'Gapfilled total'),
(63, 'BX.GSR.TRAN.ZS', 'Transport services (% of service exports, BoP)', 'Country', '', '', 'Transport (% of service exports, BoP) covers all transport services (sea, air, land, internal waterway, space, and pipeline) performed by residents of one economy for those of another and involving the carriage of passengers, movement of goods (freight), ', 'Annual', '', 'Weighted average'),
(64, 'BX.GSR.TRVL.ZS', 'Travel services (% of service exports, BoP)', 'Country', '', '', 'Travel (% of service exports, BoP) covers goods and services acquired from an economy by travelers for their own use during visits of less than one year in that economy for either business or personal purposes. Service exports refer to economic output of ', 'Annual', '', 'Weighted average'),
(65, 'BX.KLT.DINV.CD.WD', 'Foreign direct investment, net inflows (BoP, current US$)', 'Country', '', '', 'Foreign direct investment is net inflows of investment to acquire a lasting interest in or management control over an enterprise operating in an economy other than that of the investor. It is the sum of equity capital, reinvested earnings, other longterm ', 'Annual', '', 'Sum'),
(66, 'BX.KLT.DINV.WD.GD.ZS', 'Foreign direct investment, net inflows (% of GDP)', 'Country', '', '', 'Foreign direct investment are the net inflows of investment to acquire a lasting management interest (10 percent or more of voting stock) in an enterprise operating in an economy other than that of the investor. It is the sum of equity capital, reinvestme', 'Annual', '', 'Weighted average'),
(67, 'BX.KLT.DREM.CD.DT', 'Primary income on FDI (current US$)', 'Country', '', '', 'Primary income on foreign direct investment covers payments of direct investment income (debit side), which consist of income on equity (dividends, branch profits, and reinvested earnings) and income on the intercompany debt (interest). Data are in curren', 'Annual', '', 'Sum'),
(68, 'BX.PEF.TOTL.CD.WD', 'Portfolio equity, net inflows (BoP, current US$)', 'Country', '', '', 'Portfolio equity includes net inflows from equity securities other than those recorded as direct investment and including shares, stocks, depository receipts (American or global), and direct purchases of shares in local stock markets by foreign investors.', 'Annual', '', 'Sum'),
(69, 'BX.TRF.CURR.CD', 'Current transfers, receipts (BoP, current US$)', 'Country', '', '', 'Current transfers (receipts) are recorded in the balance of payments whenever an economy receives goods, services, income, or financial items without a quid pro quo. All transfers not considered to be capital are current. Data are in current U.S. dollars.', 'Annual', '', ''),
(70, 'BX.TRF.PWKR.CD', 'Workers'' remittances, receipts (BoP, current US$)', 'Country', '', '', 'Workers'' remittances are current transfers by migrants who are employed or intend to remain employed for more than a year in another economy in which they are considered residents. Some developing countries classify workers'' remittances as a factor income', 'Annual', '', 'Sum'),
(71, 'BX.TRF.PWKR.CD.DT', 'Personal transfers and compensation of employees, received (current US$)', 'Country', '', '', 'Personal transfers consist of all current transfers in cash or in kind made or received by resident households to or from nonresident households. Personal transfers thus include all current transfers between resident and nonresident individuals. Compensat', 'Annual', '', 'Sum'),
