(427, 'EN.HPT.THRD.NO', 'Plant species (higher), threatened', 'Country', '', '', 'Higher plants are native vascular plant species. Threatened species are the number of species classified by the IUCN as endangered, vulnerable, rare, indeterminate, out of danger, or insufficiently known.', 'Annual', '', 'Sum'),
(428, 'EN.MAM.THRD.NO', 'Mammal species, threatened', 'Country', '', '', 'Mammal species are mammals excluding whales and porpoises. Threatened species are the number of species classified by the IUCN as endangered, vulnerable, rare, indeterminate, out of danger, or insufficiently known.', 'Annual', '', 'Sum'),
(429, 'EN.POP.DNST', 'Population density (people per sq. km of land area)', 'Country', '', '', 'Population density is midyear population divided by land area in square kilometers. Population is based on the de facto definition of population, which counts all residents regardless of legal status or citizenshipexcept for refugees not permanently settl', 'Annual', '', 'Weighted average'),
(430, 'EN.POP.EL5M.ZS', 'Population living in areas where elevation is below 5 meters (% of total population)', 'Country', '', '', 'Population below 5m is the percentage of the total population living in areas where the elevation is 5 meters or less.', 'Annual', '', 'Weighted average'),
(431, 'EN.URB.LCTY', 'Population in largest city', 'Country', '', '', 'Population in largest city is the urban population living in the country''s largest metropolitan area.', 'Annual', '', ''),
(432, 'EN.URB.LCTY.UR.ZS', 'Population in the largest city (% of urban population)', 'Country', '', '', 'Population in largest city is the percentage of a country''s urban population living in that country''s largest metropolitan area.', 'Annual', '', 'Weighted average'),
(433, 'EN.URB.MCTY', 'Population in urban agglomerations of more than 1 million', 'Country', '', '', 'Population in urban agglomerations of more than one million is the country''s population living in metropolitan areas that in 2000 had a population of more than one million people.', 'Annual', '', ''),
(434, 'EN.URB.MCTY.TL.ZS', 'Population in urban agglomerations of more than 1 million (% of total population)', 'Country', '', '', 'Population in urban agglomerations of more than one million is the percentage of a country''s population living in metropolitan areas that in 2000 had a population of more than one million people.', 'Annual', '', 'Weighted average'),
(435, 'EP.PMP.DESL.CD', 'Pump price for diesel fuel (US$ per liter)', 'Country', '', '', 'Fuel prices refer to the pump prices of the most widely sold grade of diesel fuel. Prices have been converted from the local currency to U.S. dollars.', 'Annual', '', 'Median'),
(436, 'EP.PMP.SGAS.CD', 'Pump price for gasoline (US$ per liter)', 'Country', '', '', 'Fuel prices refer to the pump prices of the most widely sold grade of gasoline. Prices have been converted from the local currency to U.S. dollars.', 'Annual', '', 'Median'),
(437, 'ER.BDV.TOTL.XQ', 'GEF benefits index for biodiversity (0 = no biodiversity potential to 100 = maximum)', 'Country', '', '', 'GEF benefits index for biodiversity is a composite index of relative biodiversity potential for each country based on the species represented in each country, their threat status, and the diversity of habitat types in each country. The index has been norm', 'Annual', '', ''),
(438, 'ER.GDP.FWTL.M3.KD', 'Water productivity, total (constant 2000 US$ GDP per cubic meter of total freshwater withdrawal)', 'Country', '', '2000', 'Water productivity is calculated as GDP in constant prices divided by annual total water withdrawal.', 'Annual', '', 'Weighted average'),
(439, 'ER.H2O.FWAG.ZS', 'Annual freshwater withdrawals, agriculture (% of total freshwater withdrawal)', 'Country', '', '', 'Annual freshwater withdrawals refer to total water withdrawals, not counting evaporation losses from storage basins. Withdrawals also include water from desalination plants in countries where they are a significant source. Withdrawals can exceed 100 perce', 'Annual', '', 'Weighted average'),
(440, 'ER.H2O.FWDM.ZS', 'Annual freshwater withdrawals, domestic (% of total freshwater withdrawal)', 'Country', '', '', 'Annual freshwater withdrawals refer to total water withdrawals, not counting evaporation losses from storage basins. Withdrawals also include water from desalination plants in countries where they are a significant source. Withdrawals can exceed 100 perce', 'Annual', '', 'Weighted average'),
(441, 'ER.H2O.FWIN.ZS', 'Annual freshwater withdrawals, industry (% of total freshwater withdrawal)', 'Country', '', '', 'Annual freshwater withdrawals refer to total water withdrawals, not counting evaporation losses from storage basins. Withdrawals also include water from desalination plants in countries where they are a significant source. Withdrawals can exceed 100 perce', 'Annual', '', 'Weighted average'),
(442, 'ER.H2O.FWTL.K3', 'Annual freshwater withdrawals, total (billion cubic meters)', 'Country', '', '', 'Annual freshwater withdrawals refer to total water withdrawals, not counting evaporation losses from storage basins. Withdrawals also include water from desalination plants in countries where they are a significant source. Withdrawals can exceed 100 perce', 'Annual', '', 'Sum'),
(443, 'ER.H2O.FWTL.ZS', 'Annual freshwater withdrawals, total (% of internal resources)', 'Country', '', '', 'Annual freshwater withdrawals refer to total water withdrawals, not counting evaporation losses from storage basins. Withdrawals also include water from desalination plants in countries where they are a significant source. Withdrawals can exceed 100 perce', 'Annual', '', 'Weighted average'),
(444, 'ER.H2O.INTR.K3', 'Renewable internal freshwater resources, total (billion cubic meters)', 'Country', '', '', 'Renewable internal freshwater resources flows refer to internal renewable resources (internal river flows and groundwater from rainfall) in the country.', 'Annual', '', 'Sum'),
(445, 'ER.H2O.INTR.PC', 'Renewable internal freshwater resources per capita (cubic meters)', 'Country', '', '', 'Renewable internal freshwater resources flows refer to internal renewable resources (internal river flows and groundwater from rainfall) in the country. Renewable internal freshwater resources per capita are calculated using the World Bank''s population es', 'Annual', '', 'Weighted average'),
(446, 'ER.LND.PTLD.ZS', 'Terrestrial protected areas (% of total land area)', 'Country', '', '', 'Terrestrial protected areas are totally or partially protected areas of at least 1,000 hectares that are designated by national authorities as scientific reserves with limited public access, national parks, natural monuments, nature reserves or wildlife s', 'Annual', '', 'Weighted average'),
(447, 'ER.MRN.PTMR.ZS', 'Marine protected areas (% of territorial waters)', 'Country', '', '', 'Marine protected areas are areas of intertidal or subtidal terrainand overlying water and associated flora and fauna and historical and cultural featuresthat have been reserved by law or other effective means to protect part or all of the enclosed environ', 'Annual', '', 'Weighted average'),
(448, 'ER.PTD.TOTL.ZS', 'Terrestrial and marine protected areas (% of total territorial area)', 'Country', '', '', 'Terrestrial protected areas are totally or partially protected areas of at least 1,000 hectares that are designated by national authorities as scientific reserves with limited public access, national parks, natural monuments, nature reserves or wildlife s', 'Annual', '', 'Weighted average'),
(449, 'FB.AST.NPER.ZS', 'Bank nonperforming loans to total gross loans (%)', 'Country', '', '', 'Bank nonperforming loans to total gross loans are the value of nonperforming loans divided by the total value of the loan portfolio (including nonperforming loans before the deduction of specific loanloss provisions). The loan amount recorded as nonperfor', 'Annual', '', 'Median'),
(450, 'FB.ATM.TOTL.P5', 'Automated teller machines (ATMs) (per 100,000 adults)', 'Country', '', '', 'Automated teller machines are computerized telecommunications devices that provide clients of a financial institution with access to financial transactions in a public place.', 'Annual', '', 'Median'),
(451, 'FB.BNK.CAPA.ZS', 'Bank capital to assets ratio (%)', 'Country', '', '', 'Bank capital to assets is the ratio of bank capital and reserves to total assets. Capital and reserves include funds contributed by owners, retained earnings, general and special reserves, provisions, and valuation adjustments. Capital includes tier 1 cap', 'Annual', '', 'Median'),
(452, 'FB.CBK.BRCH.P5', 'Commercial bank branches (per 100,000 adults)', 'Country', '', '', 'Commercial bank branches are retail locations of resident commercial banks and other resident banks that function as commercial banks that provide financial services to customers and are physically separated from the main office but not organized as legal', 'Annual', '', 'Weighted average'),
(453, 'FB.CBK.BRWR.P3', 'Borrowers from commercial banks (per 1,000 adults)', 'Country', '', '', 'Borrowers from commercial banks are the reported number of resident customers that are nonfinancial corporations (public and private) and households who obtained loans from commercial banks and other banks functioning as commercial banks. For many countri', 'Annual', '', 'Weighted average'),
(454, 'FB.CBK.DPTR.P3', 'Depositors with commercial banks (per 1,000 adults)', 'Country', '', '', 'Depositors with commercial banks are the reported number of deposit account holders at commercial banks and other resident banks functioning as commercial banks  that are resident nonfinancial corporations (public and private) and households. For many cou', 'Annual', '', 'Weighted average'),
(455, 'FB.POS.TOTL.P5', 'Pointofsale terminals (per 100,000 adults)', 'Country', '', '', 'Pointofsale terminals are the equipment used to manage the selling process by a salespersonaccessible interface in the location where a transaction takes place.', 'Annual', '', 'Median'),
(456, 'FD.RES.LIQU.AS.ZS', 'Bank liquid reserves to bank assets ratio (%)', 'Country', '', '', 'Ratio of bank liquid reserves to bank assets is the ratio of domestic currency holdings and deposits with the monetary authorities to claims on other governments, nonfinancial public enterprises, the private sector, and other banking institutions.', 'Annual', '', 'Median'),
(457, 'FI.RES.TOTL.CD', 'Total reserves (includes gold, current US$)', 'Country', '', '', 'Total reserves comprise holdings of monetary gold, special drawing rights, reserves of IMF members held by the IMF, and holdings of foreign exchange under the control of monetary authorities. The gold component of these reserves is valued at yearend (Dece', 'Annual', '', 'Sum'),
(458, 'FI.RES.TOTL.DT.ZS', 'Total reserves (% of total external debt)', 'Country', '', '', 'International reserves to total external debt stocks.', 'Annual', '', 'Weighted average'),
(459, 'FI.RES.TOTL.MO', 'Total reserves in months of imports', 'Country', '', '', 'Total reserves comprise holdings of monetary gold, special drawing rights, reserves of IMF members held by the IMF, and holdings of foreign exchange under the control of monetary authorities. The gold component of these reserves is valued at yearend (Dece', 'Annual', '', 'Weighted average'),
(460, 'FI.RES.XGLD.CD', 'Total reserves minus gold (current US$)', 'Country', '', '', 'Total reserves minus gold comprise special drawing rights, reserves of IMF members held by the IMF, and holdings of foreign exchange under the control of monetary authorities. Gold holdings are excluded. Data are in current U.S. dollars.', 'Annual', '', 'Sum'),
(461, 'FM.AST.CGOV.ZG.M3', 'Claims on central government (annual growth as % of broad money)', 'Country', '', '', 'Claims on central government (IFS line 32AN..ZK) include loans to central government institutions net of deposits.', 'Annual', '', ''),
(462, 'FM.AST.DOMO.ZG.M3', 'Claims on other sectors of the domestic economy (annual growth as % of broad money)', 'Country', '', '', 'Claims on other sectors of the domestic economy (IFS line 32S..ZK) include gross credit from the financial system to households, nonprofit institutions serving households, nonfinancial corporations, state and local governments, and social security funds.', 'Annual', '', ''),
(463, 'FM.AST.DOMS.CN', 'Net domestic credit (current LCU)', 'Country', '', '', 'Net domestic credit is the sum of net claims on the central government and claims on other sectors of the domestic economy (IFS line 32).  Data are in current local currency.', 'Annual', '', ''),
(464, 'FM.AST.NFRG.CN', 'Net foreign assets (current LCU)', 'Country', '', '', 'Net foreign assets are the sum of foreign assets held by monetary authorities and deposit money banks, less their foreign liabilities. Data are in current local currency.', 'Annual', '', ''),
(465, 'FM.AST.PRVT.ZG.M3', 'Claims on private sector (annual growth as % of broad money)', 'Country', '', '', 'Claims on private sector (IFS line 32D..ZK or 32D..ZF) include gross credit from the financial system to individuals, enterprises, nonfinancial public entities not included under net domestic credit, and financial institutions not included elsewhere.', 'Annual', '', ''),
(466, 'FM.LBL.BMNY.CN', 'Broad money (current LCU)', 'Country', '', '', 'Broad money (IFS line 35L..ZK) is the sum of currency outside banks; demand deposits other than those of the central government; the time, savings, and foreign currency deposits of resident sectors other than the central government; bank and traveler''s ch', 'Annual', '', ''),
(467, 'FM.LBL.BMNY.GD.ZS', 'Broad money (% of GDP)', 'Country', '', '', 'Broad money (IFS line 35L..ZK) is the sum of currency outside banks; demand deposits other than those of the central government; the time, savings, and foreign currency deposits of resident sectors other than the central government; bank and traveler''s ch', 'Annual', '', 'Weighted average'),
(468, 'FM.LBL.BMNY.IR.ZS', 'Broad money to total reserves ratio', 'Country', '', '', 'Broad money (IFS line 35L..ZK) is the sum of currency outside banks; demand deposits other than those of the central government; the time, savings, and foreign currency deposits of resident sectors other than the central government; bank and traveler''s ch', 'Annual', '', ''),
(469, 'FM.LBL.BMNY.ZG', 'Broad money growth (annual %)', 'Country', '', '', 'Broad money (IFS line 35L..ZK) is the sum of currency outside banks; demand deposits other than those of the central government; the time, savings, and foreign currency deposits of resident sectors other than the central government; bank and traveler''s ch', 'Annual', '', ''),
(470, 'FM.LBL.MONY.CN', 'Money (current LCU)', 'Country', '', '', 'Money is the sum of currency outside banks and demand deposits other than those of central government. This series, frequently referred to as M1 is a narrower definition of money than M2. Data are in current local currency.', 'Annual', '', ''),
(471, 'FM.LBL.MQMY.CN', 'Money and quasi money (M2) (current LCU)', 'Country', '', '', 'Money and quasi money comprise the sum of currency outside banks, demand deposits other than those of the central government, and the time, savings, and foreign currency deposits of resident sectors other than the central government. This definition of mo', 'Annual', '', ''),
(472, 'FM.LBL.MQMY.GD.ZS', 'Money and quasi money (M2) as % of GDP', 'Country', '', '', 'Money and quasi money comprise the sum of currency outside banks, demand deposits other than those of the central government, and the time, savings, and foreign currency deposits of resident sectors other than the central government. This definition of mo', 'Annual', '', 'Weighted average'),
(473, 'FM.LBL.MQMY.IR.ZS', 'Money and quasi money (M2) to total reserves ratio', 'Country', '', '', 'Money and quasi money comprise the sum of currency outside banks, demand deposits other than those of the central government, and the time, savings, and foreign currency deposits of resident sectors other than the central government. This definition is fr', 'Annual', '', ''),
(474, 'FM.LBL.MQMY.ZG', 'Money and quasi money growth (annual %)', 'Country', '', '', 'Average annual growth rate in money and quasi money. Money and quasi money comprise the sum of currency outside banks, demand deposits other than those of the central government, and the time, savings, and foreign currency deposits of resident sectors oth', 'Annual', '', ''),
(475, 'FM.LBL.QMNY.CN', 'Quasi money (current LCU)', 'Country', '', '', 'Quasi money refers to time, savings, and foreign currency deposits of resident sectors other than the central government.', 'Annual', '', ''),
(476, 'FP.CPI.TOTL', 'Consumer price index (2005 = 100)', 'Country', '', '2005', 'Consumer price index reflects changes in the cost to the average consumer of acquiring a basket of goods and services that may be fixed or changed at specified intervals, such as yearly. The Laspeyres formula is generally used.', 'Annual', '', 'Median'),
(477, 'FP.CPI.TOTL.ZG', 'Inflation, consumer prices (annual %)', 'Country', '', '', 'Inflation as measured by the consumer price index reflects the annual percentage change in the cost to the average consumer of acquiring a basket of goods and services that may be fixed or changed at specified intervals, such as yearly. The Laspeyres form', 'Annual', '', ''),
(478, 'FP.WPI.TOTL', 'Wholesale price index (2005 = 100)', 'Country', '', '2005', 'Wholesale price index refers to a mix of agricultural and industrial goods at various stages of production and distribution, including import duties. The Laspeyres formula is generally used.', 'Annual', '', ''),
(479, 'FR.INR.DPST', 'Deposit interest rate (%)', 'Country', '', '', 'Deposit interest rate is the rate paid by commercial or similar banks for demand, time, or savings deposits. The terms and conditions attached to these rates differ by country, however, limiting their comparability.', 'Annual', '', ''),
(480, 'FR.INR.LEND', 'Lending interest rate (%)', 'Country', '', '', 'Lending rate is the bank rate that usually meets the short and mediumterm financing needs of the private sector. This rate is normally differentiated according to creditworthiness of borrowers and objectives of financing. The terms and conditions attached', 'Annual', '', ''),
(481, 'FR.INR.LNDP', 'Interest rate spread (lending rate minus deposit rate, %)', 'Country', '', '', 'Interest rate spread is the interest rate charged by banks on loans to private sector customers minus the interest rate paid by commercial or similar banks for demand, time, or savings deposits. The terms and conditions attached to these rates differ by c', 'Annual', '', 'Median'),
(482, 'FR.INR.RINR', 'Real interest rate (%)', 'Country', '', '', 'Real interest rate is the lending interest rate adjusted for inflation as measured by the GDP deflator. The terms and conditions attached to lending rates differ by country, however, limiting their comparability.', 'Annual', '', ''),
(483, 'FR.INR.RISK', 'Risk premium on lending (lending rate minus treasury bill rate, %)', 'Country', '', '', 'Risk premium on lending is the interest rate charged by banks on loans to private sector customers minus the "risk free" treasury bill interest rate at which shortterm government securities are issued or traded in the market. In some countries this spread', 'Annual', '', ''),
(484, 'FS.AST.CGOV.GD.ZS', 'Claims on central government, etc. (% GDP)', 'Country', '', '', 'Claims on central government (IFS line 52AN or 32AN) include loans to central government institutions net of deposits.', 'Annual', '', 'Weighted average'),
(485, 'FS.AST.DOMO.GD.ZS', 'Claims on other sectors of the domestic economy (% of GDP)', 'Country', '', '', 'Claims on other sectors of the domestic economy (IFS line 52S or 32S) include gross credit from the financial system to households, nonprofit institutions serving households, nonfinancial corporations, state and local governments, and social security fund', 'Annual', '', 'Weighted average'),
(486, 'FS.AST.DOMS.GD.ZS', 'Domestic credit provided by banking sector (% of GDP)', 'Country', '', '', 'Domestic credit provided by the banking sector includes all credit to various sectors on a gross basis, with the exception of credit to the central government, which is net. The banking sector includes monetary authorities and deposit money banks, as well', 'Annual', '', 'Weighted average'),
(487, 'FS.AST.PRVT.GD.ZS', 'Domestic credit to private sector (% of GDP)', 'Country', '', '', 'Domestic credit to private sector refers to financial resources provided to the private sector, such as through loans, purchases of nonequity securities, and trade credits and other accounts receivable, that establish a claim for repayment. For some count', 'Annual', '', 'Weighted average'),
(488, 'FS.LBL.LIQU.GD.ZS', 'Liquid liabilities (M3) as % of GDP', 'Country', '', '', 'Liquid liabilities are also known as M3. They are the sum of currency and deposits in the central bank (M0), plus transferable deposits and electronic currency (M1), plus time and savings deposits, foreign currency transferable deposits, certificates of d', 'Annual', '', 'Weighted average'),
(489, 'FS.LBL.QLIQ.GD.ZS', 'Quasiliquid liabilities (% of GDP)', 'Country', '', '', 'Quasiliquid liabilities are the sum of currency and deposits in the central bank (M0), plus time and savings deposits, foreign currency transferable deposits, certificates of deposit, and securities repurchase agreements, plus travelers checks, foreign cu', 'Annual', '', 'Weighted average'),
(490, 'GB.XPD.RSDV.GD.ZS', 'Research and development expenditure (% of GDP)', 'Country', '', '', 'Expenditures for research and development are current and capital expenditures (both public and private) on creative work undertaken systematically to increase knowledge, including knowledge of humanity, culture, and society, and the use of knowledge for ', 'Annual', '', 'Weighted average'),
(491, 'GC.BAL.CASH.CN', 'Cash surplus/deficit (current LCU)', 'Country', '', '', 'Cash surplus or deficit is revenue (including grants) minus expense, minus net acquisition of nonfinancial assets. In the 1986 GFS manual nonfinancial assets were included under revenue and expenditure in gross terms. This cash surplus or deficit is close', 'Annual', '', ''),
(492, 'GC.BAL.CASH.GD.ZS', 'Cash surplus/deficit (% of GDP)', 'Country', '', '', 'Cash surplus or deficit is revenue (including grants) minus expense, minus net acquisition of nonfinancial assets. In the 1986 GFS manual nonfinancial assets were included under revenue and expenditure in gross terms. This cash surplus or deficit is close', 'Annual', '', 'Weighted average'),
(493, 'GC.DOD.TOTL.CN', 'Central government debt, total (current LCU)', 'Country', '', '', 'Debt is the entire stock of direct government fixedterm contractual obligations to others outstanding on a particular date. It includes domestic and foreign liabilities such as currency and money deposits, securities other than shares, and loans. It is th', 'Annual', '', ''),
(494, 'GC.DOD.TOTL.GD.ZS', 'Central government debt, total (% of GDP)', 'Country', '', '', 'Debt is the entire stock of direct government fixedterm contractual obligations to others outstanding on a particular date. It includes domestic and foreign liabilities such as currency and money deposits, securities other than shares, and loans. It is th', 'Annual', '', 'Median'),
(495, 'GC.FIN.DOMS.CN', 'Net incurrence of liabilities, domestic (current LCU)', 'Country', '', '', 'Net incurrence of government liabilities includes foreign financing (obtained from nonresidents) and domestic financing (obtained from residents), or the means by which a government provides financial resources to cover a budget deficit or allocates finan', 'Annual', '', ''),
(496, 'GC.FIN.DOMS.GD.ZS', 'Net incurrence of liabilities, domestic (% of GDP)', 'Country', '', '', 'Net incurrence of government liabilities includes foreign financing (obtained from nonresidents) and domestic financing (obtained from residents), or the means by which a government provides financial resources to cover a budget deficit or allocates finan', 'Annual', '', 'Median'),
(497, 'GC.FIN.FRGN.CN', 'Net incurrence of liabilities, foreign (current LCU)', 'Country', '', '', 'Net incurrence of government liabilities includes foreign financing (obtained from nonresidents) and domestic financing (obtained from residents), or the means by which a government provides financial resources to cover a budget deficit or allocates finan', 'Annual', '', ''),
(498, 'GC.FIN.FRGN.GD.ZS', 'Net incurrence of liabilities, foreign (% of GDP)', 'Country', '', '', 'Net incurrence of government liabilities includes foreign financing (obtained from nonresidents) and domestic financing (obtained from residents), or the means by which a government provides financial resources to cover a budget deficit or allocates finan', 'Annual', '', 'Median'),
(499, 'GC.REV.GOTR.CN', 'Grants and other revenue (current LCU)', 'Country', '', '', 'Grants and other revenue include grants from other foreign governments, international organizations, and other government units; interest; dividends; rent; requited, nonrepayable receipts for public purposes (such as fines, administrative fees, and entrep', 'Annual', '', ''),
(500, 'GC.REV.GOTR.ZS', 'Grants and other revenue (% of revenue)', 'Country', '', '', 'Grants and other revenue include grants from other foreign governments, international organizations, and other government units; interest; dividends; rent; requited, nonrepayable receipts for public purposes (such as fines, administrative fees, and entrep', 'Annual', '', 'Median'),
(501, 'GC.REV.SOCL.CN', 'Social contributions (current LCU)', 'Country', '', '', 'Social contributions include social security contributions by employees, employers, and selfemployed individuals, and other contributions whose source cannot be determined. They also include actual or imputed contributions to social insurance schemes oper', 'Annual', '', ''),
(502, 'GC.REV.SOCL.ZS', 'Social contributions (% of revenue)', 'Country', '', '', 'Social contributions include social security contributions by employees, employers, and selfemployed individuals, and other contributions whose source cannot be determined. They also include actual or imputed contributions to social insurance schemes oper', 'Annual', '', 'Median'),
(503, 'GC.REV.XGRT.CN', 'Revenue, excluding grants (current LCU)', 'Country', '', '', 'Revenue is cash receipts from taxes, social contributions, and other revenues such as fines, fees, rent, and income from property or sales. Grants are also considered as revenue but are excluded here.', 'Annual', '', ''),
(504, 'GC.REV.XGRT.GD.ZS', 'Revenue, excluding grants (% of GDP)', 'Country', '', '', 'Revenue is cash receipts from taxes, social contributions, and other revenues such as fines, fees, rent, and income from property or sales. Grants are also considered as revenue but are excluded here.', 'Annual', '', 'Weighted average'),
(505, 'GC.TAX.EXPT.CN', 'Taxes on exports (current LCU)', 'Country', '', '', 'Taxes on exports are all levies on goods being transported out of the country or services being delivered to nonresidents by residents. Rebates on exported goods that are repayments of previously paid general consumption taxes, excise taxes, or import dut', 'Annual', '', ''),
(506, 'GC.TAX.EXPT.ZS', 'Taxes on exports (% of tax revenue)', 'Country', '', '', 'Taxes on exports are all levies on goods being transported out of the country or services being delivered to nonresidents by residents. Rebates on exported goods that are repayments of previously paid general consumption taxes, excise taxes, or import dut', 'Annual', '', ''),
(507, 'GC.TAX.GSRV.CN', 'Taxes on goods and services (current LCU)', 'Country', '', '', 'Taxes on goods and services include general sales and turnover or value added taxes, selective excises on goods, selective taxes on services, taxes on the use of goods or property, taxes on extraction and production of minerals, and profits of fiscal mono', 'Annual', '', ''),
(508, 'GC.TAX.GSRV.RV.ZS', 'Taxes on goods and services (% of revenue)', 'Country', '', '', 'Taxes on goods and services include general sales and turnover or value added taxes, selective excises on goods, selective taxes on services, taxes on the use of goods or property, taxes on extraction and production of minerals, and profits of fiscal mono', 'Annual', '', 'Median'),
(509, 'GC.TAX.GSRV.VA.ZS', 'Taxes on goods and services (% value added of industry and services)', 'Country', '', '', 'Taxes on goods and services include general sales and turnover or value added taxes, selective excises on goods, selective taxes on services, taxes on the use of goods or property, taxes on extraction and production of minerals, and profits of fiscal mono', 'Annual', '', ''),
(510, 'GC.TAX.IMPT.CN', 'Customs and other import duties (current LCU)', 'Country', '', '', 'Customs and other import duties are all levies collected on goods that are entering the country or services delivered by nonresidents to residents. They include levies imposed for revenue or protection purposes and determined on a specific or ad valorem b', 'Annual', '', ''),
(511, 'GC.TAX.IMPT.ZS', 'Customs and other import duties (% of tax revenue)', 'Country', '', '', 'Customs and other import duties are all levies collected on goods that are entering the country or services delivered by nonresidents to residents. They include levies imposed for revenue or protection purposes and determined on a specific or ad valorem b', 'Annual', '', ''),
(512, 'GC.TAX.INTT.CN', 'Taxes on international trade (current LCU)', 'Country', '', '', 'Taxes on international trade include import duties, export duties, profits of export or import monopolies, exchange profits, and exchange taxes.', 'Annual', '', ''),
(513, 'GC.TAX.INTT.RV.ZS', 'Taxes on international trade (% of revenue)', 'Country', '', '', 'Taxes on international trade include import duties, export duties, profits of export or import monopolies, exchange profits, and exchange taxes.', 'Annual', '', 'Median'),
(514, 'GC.TAX.OTHR.CN', 'Other taxes (current LCU)', 'Country', '', '', 'Other taxes include employer payroll or labor taxes, taxes on property, and taxes not allocable to other categories, such as penalties for late payment or nonpayment of taxes.', 'Annual', '', ''),
(515, 'GC.TAX.OTHR.RV.ZS', 'Other taxes (% of revenue)', 'Country', '', '', 'Other taxes include employer payroll or labor taxes, taxes on property, and taxes not allocable to other categories, such as penalties for late payment or nonpayment of taxes.', 'Annual', '', 'Median'),
(516, 'GC.TAX.TOTL.CN', 'Tax revenue (current LCU)', 'Country', '', '', 'Tax revenue refers to compulsory transfers to the central government for public purposes. Certain compulsory transfers such as fines, penalties, and most social security contributions are excluded. Refunds and corrections of erroneously collected tax reve', 'Annual', '', ''),
(517, 'GC.TAX.TOTL.GD.ZS', 'Tax revenue (% of GDP)', 'Country', '', '', 'Tax revenue refers to compulsory transfers to the central government for public purposes. Certain compulsory transfers such as fines, penalties, and most social security contributions are excluded. Refunds and corrections of erroneously collected tax reve', 'Annual', '', 'Weighted average'),
(518, 'GC.TAX.YPKG.CN', 'Taxes on income, profits and capital gains (current LCU)', 'Country', '', '', 'Taxes on income, profits, and capital gains are levied on the actual or presumptive net income of individuals, on the profits of corporations and enterprises, and on capital gains, whether realized or not, on land, securities, and other assets. Intragover', 'Annual', '', ''),
(519, 'GC.TAX.YPKG.RV.ZS', 'Taxes on income, profits and capital gains (% of revenue)', 'Country', '', '', 'Taxes on income, profits, and capital gains are levied on the actual or presumptive net income of individuals, on the profits of corporations and enterprises, and on capital gains, whether realized or not, on land, securities, and other assets. Intragover', 'Annual', '', 'Median'),
(520, 'GC.TAX.YPKG.ZS', 'Taxes on income, profits and capital gains (% of total taxes)', 'Country', '', '', 'Taxes on income, profits, and capital gains are levied on the actual or presumptive net income of individuals, on the profits of corporations and enterprises, and on capital gains, whether realized or not, on land, securities, and other assets. Intragover', 'Annual', '', ''),
(521, 'GC.XPN.COMP.CN', 'Compensation of employees (current LCU)', 'Country', '', '', 'Compensation of employees consists of all payments in cash, as well as in kind (such as food and housing), to employees in return for services rendered, and government contributions to social insurance schemes such as social security and pensions that pro', 'Annual', '', ''),
(522, 'GC.XPN.COMP.ZS', 'Compensation of employees (% of expense)', 'Country', '', '', 'Compensation of employees consists of all payments in cash, as well as in kind (such as food and housing), to employees in return for services rendered, and government contributions to social insurance schemes such as social security and pensions that pro', 'Annual', '', 'Median'),
(523, 'GC.XPN.GSRV.CN', 'Goods and services expense (current LCU)', 'Country', '', '', 'Goods and services include all government payments in exchange for goods and services used for the production of market and nonmarket goods and services. Ownaccount capital formation is excluded.', 'Annual', '', ''),
(524, 'GC.XPN.GSRV.ZS', 'Goods and services expense (% of expense)', 'Country', '', '', 'Goods and services include all government payments in exchange for goods and services used for the production of market and nonmarket goods and services. Ownaccount capital formation is excluded.', 'Annual', '', 'Median'),
(525, 'GC.XPN.INTP.CN', 'Interest payments (current LCU)', 'Country', '', '', 'Interest payments include interest payments on government debtincluding longterm bonds, longterm loans, and other debt instrumentsto domestic and foreign residents.', 'Annual', '', ''),
(526, 'GC.XPN.INTP.RV.ZS', 'Interest payments (% of revenue)', 'Country', '', '', 'Interest payments include interest payments on government debtincluding longterm bonds, longterm loans, and other debt instrumentsto domestic and foreign residents.', 'Annual', '', 'Median'),
(527, 'GC.XPN.INTP.ZS', 'Interest payments (% of expense)', 'Country', '', '', 'Interest payments include interest payments on government debtincluding longterm bonds, longterm loans, and other debt instrumentsto domestic and foreign residents.', 'Annual', '', 'Median'),
(528, 'GC.XPN.OTHR.CN', 'Other expense (current LCU)', 'Country', '', '', 'Other expense is spending on dividends, rent, and other miscellaneous expenses, including provision for consumption of fixed capital.', 'Annual', '', ''),
(529, 'GC.XPN.OTHR.ZS', 'Other expense (% of expense)', 'Country', '', '', 'Other expense is spending on dividends, rent, and other miscellaneous expenses, including provision for consumption of fixed capital.', 'Annual', '', 'Median'),
(530, 'GC.XPN.TOTL.CN', 'Expense (current LCU)', 'Country', '', '', 'Expense is cash payments for operating activities of the government in providing goods and services. It includes compensation of employees (such as wages and salaries), interest and subsidies, grants, social benefits, and other expenses such as rent and d', 'Annual', '', ''),
(531, 'GC.XPN.TOTL.GD.ZS', 'Expense (% of GDP)', 'Country', '', '', 'Expense is cash payments for operating activities of the government in providing goods and services. It includes compensation of employees (such as wages and salaries), interest and subsidies, grants, social benefits, and other expenses such as rent and d', 'Annual', '', 'Weighted average'),
(532, 'GC.XPN.TRFT.CN', 'Subsidies and other transfers (current LCU)', 'Country', '', '', 'Subsidies, grants, and other social benefits include all unrequited, nonrepayable transfers on current account to private and public enterprises; grants to foreign governments, international organizations, and other government units; and social security, ', 'Annual', '', ''),
(533, 'GC.XPN.TRFT.ZS', 'Subsidies and other transfers (% of expense)', 'Country', '', '', 'Subsidies, grants, and other social benefits include all unrequited, nonrepayable transfers on current account to private and public enterprises; grants to foreign governments, international organizations, and other government units; and social security, ', 'Annual', '', 'Median'),
(534, 'IC.BUS.DISC.XQ', 'Business extent of disclosure index (0=less disclosure to 10=more disclosure)', 'Country', '', '', 'Disclosure index measures the extent to which investors are protected through disclosure of ownership and financial information. The index ranges from 0 to 10, with higher values indicating more disclosure.', 'Annual', '', 'Unweighted average'),
(535, 'IC.BUS.EASE.XQ', 'Ease of doing business index (1=most businessfriendly regulations)', 'Country', '', '', 'Ease of doing business ranks economies from 1 to 185, with first place being the best. A high ranking (a low numerical rank) means that the regulatory environment is conducive to business operation. The index averages the country''s percentile rankings on ', 'Annual', '', 'Unweighted average'),
(536, 'IC.BUS.NDNS.ZS', 'New business density (new registrations per 1,000 people ages 1564)', 'Country', '', '', 'New businesses registered are the number of new limited liability corporations registered in the calendar year.', 'Annual', '', 'Unweighted average'),
(537, 'IC.BUS.NREG', 'New businesses registered (number)', 'Country', '', '', 'New businesses registered are the number of new limited liability corporations registered in the calendar year.', 'Annual', '', ''),
(538, 'IC.CRD.INFO.XQ', 'Credit depth of information index (0=low to 6=high)', 'Country', '', '', 'Credit depth of information index measures rules affecting the scope, accessibility, and quality of credit information available through public or private credit registries. The index ranges from 0 to 6, with higher values indicating the availability of m', 'Annual', '', 'Unweighted average'),
(539, 'IC.CRD.PRVT.ZS', 'Private credit bureau coverage (% of adults)', 'Country', '', '', 'Private credit bureau coverage reports the number of individuals or firms listed by a private credit bureau with current information on repayment history, unpaid debts, or credit outstanding. The number is expressed as a percentage of the adult population', 'Annual', '', 'Unweighted average'),
(540, 'IC.CRD.PUBL.ZS', 'Public credit registry coverage (% of adults)', 'Country', '', '', 'Public credit registry coverage reports the number of individuals and firms listed in a public credit registry with current information on repayment history, unpaid debts, or credit outstanding. The number is expressed as a percentage of the adult populat', 'Annual', '', 'Unweighted average'),
(541, 'IC.CUS.DURS.EX', 'Average time to clear exports through customs (days)', 'Country', '', '', 'Average time to clear exports through customs is the average number of days to clear direct exports through customs.', 'Annual', '', ''),
(542, 'IC.ELC.DURS', 'Delay in obtaining an electrical connection (days)', 'Country', '', '', 'Delay in obtaining an electrical connection is the average wait, in days, experienced to obtain an electrical connection from the day an establishment applies for it to the day it receives the service.', 'Annual', '', ''),
(543, 'IC.ELC.OUTG', 'Power outages in firms in a typical month (number)', 'Country', '', '', 'Power outages are the average number of power outages that establishments experience in a typical month.', 'Annual', '', ''),
(544, 'IC.ELC.TIME', 'Time required to get electricity (days)', 'Country', '', '', 'Time required to get electricity is the number of days to obtain a permanent electricity connection. The measure captures the median duration that the electricity utility and experts indicate is necessary in practice, rather than required by law, to compl', 'Annual', '', 'Unweighted average'),
(545, 'IC.EMP.FIRE.WK', 'Firing cost (weeks of wages)', 'Country', '', '', 'Firing cost is the cost of advanced notice requirements, severance payments, and penalties due when terminating a redundant worker, expressed in weekly wages. One month is recorded as 4 1/3 weeks.', 'Annual', '', 'Unweighted average'),
(546, 'IC.EXP.COST.CD', 'Cost to export (US$ per container)', 'Country', '', '', 'Cost measures the fees levied on a 20foot container in U.S. dollars. All the fees associated with completing the procedures to export or import the goods are included. These include costs for documents, administrative fees for customs clearance and techni', 'Annual', '', 'Unweighted average'),
(547, 'IC.EXP.DOCS', 'Documents to export (number)', 'Country', '', '', 'Documents to export are all documents required per shipment by government ministries, customs authorities, port and container terminals, health and technical control agencies, and banks to export goods. Documents renewed annually and not requiring renewal', 'Annual', '', 'Unweighted average'),
(548, 'IC.EXP.DURS', 'Time to export (days)', 'Country', '', '', 'Time is recorded in calendar days. The time calculation for a procedure starts from the moment it is initiated and runs until it is completed. If a procedure can be accelerated for an additional cost, the fastest legal procedure is chosen. It is assumed t', 'Annual', '', 'Unweighted average'),
(549, 'IC.FRM.BNKS.ZS', 'Firms using banks to finance investment (% of firms)', 'Country', '', '', 'Firms using banks to finance investment are the percentage of firms using banks to finance investments.', 'Annual', '', ''),
(550, 'IC.FRM.CORR.ZS', 'Informal payments to public officials (% of firms)', 'Country', '', '', 'Informal payments to public officials are the percentage of firms expected to make informal payments to public officials to "get things done" with regard to customs, taxes, licenses, regulations, services, and the like.', 'Annual', '', ''),
(551, 'IC.FRM.CRIM.ZS', 'Losses due to theft, robbery, vandalism, and arson (% sales)', 'Country', '', '', 'Losses due to theft, robbery, vandalism, and arson are the estimated losses from those causes that occurred on establishments'' premises as a percentage of annual sales.', 'Annual', '', ''),
(552, 'IC.FRM.DURS', 'Time required to obtain an operating license (days)', 'Country', '', '', 'Time required to obtain operating license is the average wait to obtain an operating license from the day the establishment applied for it to the day it was granted.', 'Annual', '', ''),
(553, 'IC.FRM.FEMO.ZS', 'Firms with female participation in ownership (% of firms)', 'Country', '', '', 'Firms with female participation in ownership are the percentage of firms with a woman among the principal owners.', 'Annual', '', ''),
(554, 'IC.FRM.FREG.ZS', 'Firms formally registered when operations started (% of firms)', 'Country', '', '', 'Firms formally registered when operations started are the percentage of firms formally registered when they started operations in the country.', 'Annual', '', ''),
(555, 'IC.FRM.INFM.ZS', 'Firms that do not report all sales for tax purposes (% of firms)', 'Country', '', '', 'Firms that do not report all sales for tax purposes are the percentage of firms that expressed that a typical firm reports less than 100 percent of sales for tax purposes; such firms are termed "informal firms."', 'Annual', '', ''),
(556, 'IC.FRM.ISOC.ZS', 'ISO certification ownership (% of firms)', 'Country', '', '', 'ISO certification ownership is the percentage of firms that have earned a quality certification recognized by the International Organization for Standardization (ISO).', 'Annual', '', ''),
(557, 'IC.FRM.OUTG.ZS', 'Value lost due to electrical outages (% of sales)', 'Country', '', '', 'Value lost due to electrical outages is the percentage of sales lost due to power outages.', 'Annual', '', ''),
(558, 'IC.FRM.TRNG.ZS', 'Firms offering formal training (% of firms)', 'Country', '', '', 'Firms offering formal training are the percentage of firms offering formal training programs for their permanent, fulltime employees.', 'Annual', '', ''),
(559, 'IC.GOV.DURS.ZS', 'Management time dealing with officials (% of management time)', 'Country', '', '', 'Time dealing with officials is the percentage of management time in a given week spent on requirements imposed by government regulations (taxes, customs, labor regulations, licensing and registration).', 'Annual', '', ''),
(560, 'IC.IMP.COST.CD', 'Cost to import (US$ per container)', 'Country', '', '', 'Cost measures the fees levied on a 20foot container in U.S. dollars. All the fees associated with completing the procedures to export or import the goods are included. These include costs for documents, administrative fees for customs clearance and techni', 'Annual', '', 'Unweighted average'),
(561, 'IC.IMP.DOCS', 'Documents to import (number)', 'Country', '', '', 'Documents to import are all documents required per shipment by government ministries, customs authorities, port and container terminals, health and technical control agencies, and banks to import goods. Documents renewed annually and not requiring renewal', 'Annual', '', 'Unweighted average'),
(562, 'IC.IMP.DURS', 'Time to import (days)', 'Country', '', '', 'Time is recorded in calendar days. The time calculation for a procedure starts from the moment it is initiated and runs until it is completed. If a procedure can be accelerated for an additional cost, the fastest legal procedure is chosen. It is assumed t', 'Annual', '', 'Unweighted average'),
(563, 'IC.ISV.DURS', 'Time to resolve insolvency (years)', 'Country', '', '', 'Time to resolve insolvency is the number of years from the filing for insolvency in court until the resolution of distressed assets.', 'Annual', '', 'Unweighted average'),
(564, 'IC.LGL.CRED.XQ', 'Strength of legal rights index (0=weak to 10=strong)', 'Country', '', '', 'Strength of legal rights index measures the degree to which collateral and bankruptcy laws protect the rights of borrowers and lenders and thus facilitate lending. The index ranges from 0 to 10, with higher scores indicating that these laws are better des', 'Annual', '', 'Unweighted average'),
(565, 'IC.LGL.DURS', 'Time required to enforce a contract (days)', 'Country', '', '', 'Time required to enforce a contract is the number of calendar days from the filing of the lawsuit in court until the final determination and, in appropriate cases, payment.', 'Annual', '', 'Unweighted average'),
(566, 'IC.LGL.PROC', 'Procedures to enforce a contract (number)', 'Country', '', '', 'Number of procedures to enforce a contract are the number of independent actions, mandated by law or courts, that demand interaction between the parties of a contract or between them and the judge or court officer.', 'Annual', '', 'Unweighted average'),
(567, 'IC.PRP.DURS', 'Time required to register property (days)', 'Country', '', '', 'Time required to register property is the number of calendar days needed for businesses to secure rights to property.', 'Annual', '', 'Unweighted average'),
(568, 'IC.PRP.PROC', 'Procedures to register property (number)', 'Country', '', '', 'Number of procedures to register property is the number of procedures required for a businesses to secure rights to property.', 'Annual', '', 'Unweighted average'),
(569, 'IC.REG.COST.PC.ZS', 'Cost of business startup procedures (% of GNI per capita)', 'Country', '', '', 'Cost to register a business is normalized by presenting it as a percentage of gross national income (GNI) per capita.', 'Annual', '', 'Unweighted average'),
(570, 'IC.REG.DURS', 'Time required to start a business (days)', 'Country', '', '', 'Time required to start a business is the number of calendar days needed to complete the procedures to legally operate a business. If a procedure can be speeded up at additional cost, the fastest procedure, independent of cost, is chosen.', 'Annual', '', 'Unweighted average');
INSERT INTO `base_geoindicator` (`id`, `code`, `name`, `geo_type`, `value_type`, `base_period`, `description`, `periodicity`, `status`, `aggregation_method`) VALUES
(571, 'IC.REG.PROC', 'Startup procedures to register a business (number)', 'Country', '', '', 'Startup procedures are those required to start a business, including interactions to obtain necessary permits and licenses and to complete all inscriptions, verifications, and notifications to start operations. Data are for businesses with specific charac', 'Annual', '', 'Unweighted average'),
(572, 'IC.TAX.DURS', 'Time to prepare and pay taxes (hours)', 'Country', '', '', 'Time to prepare and pay taxes is the time, in hours per year, it takes to prepare, file, and pay (or withhold) three major types of taxes: the corporate income tax, the value added or sales tax, and labor taxes, including payroll taxes and social security', 'Annual', '', 'Unweighted average'),
(573, 'IC.TAX.GIFT.ZS', 'Firms expected to give gifts in meetings with tax officials (% of firms)', 'Country', '', '', 'Firms expected to give gifts in meetings with tax officials is the percentage of firms that answered positively to the question "was a gift or informal payment expected or requested during a meeting with tax officials?"', 'Annual', '', ''),
(574, 'IC.TAX.LABR.CP.ZS', 'Labor tax and contributions (% of commercial profits)', 'Country', '', '', 'Labor tax and contributions is the amount of taxes and mandatory contributions on labor paid by the business.', 'Annual', '', 'Unweighted average'),
(575, 'IC.TAX.METG', 'Average number of times firms spent in meetings with tax officials', 'Country', '', '', 'Average number of times management met with tax officials is the average number of visits or required meetings with tax officials.', 'Annual', '', ''),
(576, 'IC.TAX.OTHR.CP.ZS', 'Other taxes payable by businesses (% of commercial profits)', 'Country', '', '', 'Other taxes payable by businesses include the amounts paid for property taxes, turnover taxes, and other small taxes such as municipal fees and vehicle and fuel taxes.', 'Annual', '', 'Unweighted average'),
(577, 'IC.TAX.PAYM', 'Tax payments (number)', 'Country', '', '', 'Tax payments by businesses are the total number of taxes paid by businesses, including electronic filing. The tax is counted as paid once a year even if payments are more frequent.', 'Annual', '', 'Unweighted average'),
(578, 'IC.TAX.PRFT.CP.ZS', 'Profit tax (% of commercial profits)', 'Country', '', '', 'Profit tax is the amount of taxes on profits paid by the business.', 'Annual', '', 'Unweighted average'),
(579, 'IC.TAX.TOTL.CP.ZS', 'Total tax rate (% of commercial profits)', 'Country', '', '', 'Total tax rate measures the amount of taxes and mandatory contributions payable by businesses after accounting for allowable deductions and exemptions as a share of commercial profits. Taxes withheld (such as personal income tax) or collected and remitted', 'Annual', '', 'Unweighted average'),
(580, 'IC.WRH.DURS', 'Time required to build a warehouse (days)', 'Country', '', '', 'Time required to build a warehouse is the number of calendar days needed to complete the required procedures for building a warehouse. If a procedure can be speeded up at additional cost, the fastest procedure, independent of cost, is chosen.', 'Annual', '', 'Unweighted average'),
(581, 'IC.WRH.PROC', 'Procedures to build a warehouse (number)', 'Country', '', '', 'Number of procedures to build a warehouse is the number of interactions of a company''s employees or managers with external parties, including government agency staff, public inspectors, notaries, land registry and cadastre staff, and technical experts apa', 'Annual', '', 'Unweighted average'),
(582, 'IE.PPI.ENGY.CD', 'Investment in energy with private participation (current US$)', 'Country', '', '', 'Investment in energy with private participation is the value of energy projects that have reached financial closure and directly or indirectly serve the public, including operation and management contracts with major capital expenditure, greenfield projec', 'Annual', '', 'Sum'),
(583, 'IE.PPI.TELE.CD', 'Investment in telecoms with private participation (current US$)', 'Country', '', '', 'Investment in telecoms with private participation is the value of telecom projects that have reached financial closure and directly or indirectly serve the public, including operation and management contracts with major capital expenditure, greenfield pro', 'Annual', '', 'Sum'),
(584, 'IE.PPI.TRAN.CD', 'Investment in transport with private participation (current US$)', 'Country', '', '', 'Investment in transport with private participation is the value of transportation projects that have reached financial closure and directly or indirectly serve the public, including operation and management contracts with major capital expenditure, greenf', 'Annual', '', 'Sum'),
(585, 'IE.PPI.WATR.CD', 'Investment in water and sanitation with private participation (current US$)', 'Country', '', '', 'Investment in water and sanitation with private participation is the value of water and sanitation projects that have reached financial closure and directly or indirectly serve the public, including operation and management contracts with major capital ex', 'Annual', '', 'Sum'),
(586, 'IP.JRN.ARTC.SC', 'Scientific and technical journal articles', 'Country', '', '', 'Scientific and technical journal articles refer to the number of scientific and engineering articles published in the following fields: physics, biology, chemistry, mathematics, clinical medicine, biomedical research, engineering and technology, and earth', 'Annual', '', 'Sum'),
(587, 'IP.PAT.NRES', 'Patent applications, nonresidents', 'Country', '', '', 'Patent applications are worldwide patent applications filed through the Patent Cooperation Treaty procedure or with a national patent office.', 'Annual', '', 'Sum'),
(588, 'IP.PAT.RESD', 'Patent applications, residents', 'Country', '', '', 'Patent applications are worldwide patent applications filed through the Patent Cooperation Treaty procedure or with a national patent office.', 'Annual', '', 'Sum'),
(589, 'IP.TMK.AGGD', 'Trademark applications, aggregate direct', 'Country', '', '', 'Trademark applications filed are applications to register a trademark with a national or regional Intellectual Property (IP) office. Aggregate direct trademark applications are those filed by applicants without regard to the residency of the applicant. Th', 'Annual', '', 'Sum'),
(590, 'IP.TMK.MDRD', 'Trademark applications, Madrid', 'Country', '', '', 'Trademark applications filed are applications to register a trademark with a national or regional Intellectual Property (IP) office. Madrid trademark applications are those received by the national or regional IP office as a result of an international app', 'Annual', '', 'Sum'),
(591, 'IP.TMK.NRES', 'Trademark applications, direct nonresident', 'Country', '', '', 'Trademark applications filed are applications to register a trademark with a national or regional Intellectual Property (IP) office. Direct nonresident trademark applications are those filed by applicants from abroad directly at a given national IP office', 'Annual', '', 'Sum'),
(592, 'IP.TMK.RESD', 'Trademark applications, direct resident', 'Country', '', '', 'Trademark applications filed are applications to register a trademark with a national or regional Intellectual Property (IP) office. Direct resident trademark applications are those filed by domestic applicants directly at a given national IP office.', 'Annual', '', 'Sum'),
(593, 'IP.TMK.TOTL', 'Trademark applications, total', 'Country', '', '', 'Trademark applications filed are applications to register a trademark with a national or regional Intellectual Property (IP) office.', 'Annual', '', 'Sum'),
(594, 'IQ.CPA.BREG.XQ', 'CPIA business regulatory environment rating (1=low to 6=high)', 'Country', '', '', 'Business regulatory environment assesses the extent to which the legal, regulatory, and policy environments help or hinder private businesses in investing, creating jobs, and becoming more productive.', 'Annual', '', ''),
(595, 'IQ.CPA.DEBT.XQ', 'CPIA debt policy rating (1=low to 6=high)', 'Country', '', '', 'Debt policy assesses whether the debt management strategy is conducive to minimizing budgetary risks and ensuring longterm debt sustainability.', 'Annual', '', ''),
(596, 'IQ.CPA.ECON.XQ', 'CPIA economic management cluster average (1=low to 6=high)', 'Country', '', '', 'The economic management cluster includes macroeconomic management, fiscal policy, and debt policy.', 'Annual', '', ''),
(597, 'IQ.CPA.ENVR.XQ', 'CPIA policy and institutions for environmental sustainability rating (1=low to 6=high)', 'Country', '', '', 'Policy and institutions for environmental sustainability assess the extent to which environmental policies foster the protection and sustainable use of natural resources and the management of pollution.', 'Annual', '', ''),
(598, 'IQ.CPA.FINQ.XQ', 'CPIA quality of budgetary and financial management rating (1=low to 6=high)', 'Country', '', '', 'Quality of budgetary and financial management assesses the extent to which there is a comprehensive and credible budget linked to policy priorities, effective financial management systems, and timely and accurate accounting and fiscal reporting, including', 'Annual', '', ''),
(599, 'IQ.CPA.FINS.XQ', 'CPIA financial sector rating (1=low to 6=high)', 'Country', '', '', 'Financial sector assesses the structure of the financial sector and the policies and regulations that affect it.', 'Annual', '', ''),
(600, 'IQ.CPA.FISP.XQ', 'CPIA fiscal policy rating (1=low to 6=high)', 'Country', '', '', 'Fiscal policy assesses the short and mediumterm sustainability of fiscal policy (taking into account monetary and exchange rate policy and the sustainability of the public debt) and its impact on growth.', 'Annual', '', ''),
(601, 'IQ.CPA.GNDR.XQ', 'CPIA gender equality rating (1=low to 6=high)', 'Country', '', '', 'Gender equality assesses the extent to which the country has installed institutions and programs to enforce laws and policies that promote equal access for men and women in education, health, the economy, and protection under law.', 'Annual', '', ''),
(602, 'IQ.CPA.HRES.XQ', 'CPIA building human resources rating (1=low to 6=high)', 'Country', '', '', 'Building human resources assesses the national policies and public and private sector service delivery that affect the access to and quality of health and education services, including prevention and treatment of HIV/AIDS, tuberculosis, and malaria.', 'Annual', '', ''),
(603, 'IQ.CPA.IRAI.XQ', 'IDA resource allocation index (1=low to 6=high)', 'Country', '', '', 'IDA Resource Allocation Index is obtained by calculating the average score for each cluster and then by averaging those scores. For each of 16 criteria countries are rated on a scale of 1 (low) to 6 (high).', 'Annual', '', ''),
(604, 'IQ.CPA.MACR.XQ', 'CPIA macroeconomic management rating (1=low to 6=high)', 'Country', '', '', 'Macroeconomic management assesses the monetary, exchange rate, and aggregate demand policy framework.', 'Annual', '', ''),
(605, 'IQ.CPA.PADM.XQ', 'CPIA quality of public administration rating (1=low to 6=high)', 'Country', '', '', 'Quality of public administration assesses the extent to which civilian central government staff is structured to design and implement government policy and deliver services effectively.', 'Annual', '', ''),
(606, 'IQ.CPA.PRES.XQ', 'CPIA equity of public resource use rating (1=low to 6=high)', 'Country', '', '', 'Equity of public resource use assesses the extent to which the pattern of public expenditures and revenue collection affects the poor and is consistent with national poverty reduction priorities.', 'Annual', '', ''),
(607, 'IQ.CPA.PROP.XQ', 'CPIA property rights and rulebased governance rating (1=low to 6=high)', 'Country', '', '', 'Property rights and rulebased governance assess the extent to which private economic activity is facilitated by an effective legal system and rulebased governance structure in which property and contract rights are reliably respected and enforced.', 'Annual', '', ''),
(608, 'IQ.CPA.PROT.XQ', 'CPIA social protection rating (1=low to 6=high)', 'Country', '', '', 'Social protection and labor assess government policies in social protection and labor market regulations that reduce the risk of becoming poor, assist those who are poor to better manage further risks, and ensure a minimal level of welfare to all people.', 'Annual', '', ''),
(609, 'IQ.CPA.PUBS.XQ', 'CPIA public sector management and institutions cluster average (1=low to 6=high)', 'Country', '', '', 'The public sector management and institutions cluster includes property rights and rulebased governance, quality of budgetary and financial management, efficiency of revenue mobilization, quality of public administration, and transparency, accountability,', 'Annual', '', ''),
(610, 'IQ.CPA.REVN.XQ', 'CPIA efficiency of revenue mobilization rating (1=low to 6=high)', 'Country', '', '', 'Efficiency of revenue mobilization assesses the overall pattern of revenue mobilizationnot only the de facto tax structure, but also revenue from all sources as actually collected.', 'Annual', '', ''),
(611, 'IQ.CPA.SOCI.XQ', 'CPIA policies for social inclusion/equity cluster average (1=low to 6=high)', 'Country', '', '', 'The policies for social inclusion and equity cluster includes gender equality, equity of public resource use, building human resources, social protection and labor, and policies and institutions for environmental sustainability.', 'Annual', '', ''),
(612, 'IQ.CPA.STRC.XQ', 'CPIA structural policies cluster average (1=low to 6=high)', 'Country', '', '', 'The structural policies cluster includes trade, financial sector, and business regulatory environment.', 'Annual', '', ''),
(613, 'IQ.CPA.TRAD.XQ', 'CPIA trade rating (1=low to 6=high)', 'Country', '', '', 'Trade assesses how the policy framework fosters trade in goods.', 'Annual', '', ''),
(614, 'IQ.CPA.TRAN.XQ', 'CPIA transparency, accountability, and corruption in the public sector rating (1=low to 6=high)', 'Country', '', '', 'Transparency, accountability, and corruption in the public sector assess the extent to which the executive can be held accountable for its use of funds and for the results of its actions by the electorate and by the legislature and judiciary, and the exte', 'Annual', '', ''),
(615, 'IQ.WEF.CUST.XQ', 'Burden of customs procedure, WEF (1=extremely inefficient to 7=extremely efficient)', 'Country', '', '', 'Burden of Customs Procedure measures business executives'' perceptions of their country''s efficiency of customs procedures. The rating ranges from 1 to 7, with a higher score indicating greater efficiency.', 'Annual', '', 'Unweighted average'),
(616, 'IQ.WEF.PORT.XQ', 'Quality of port infrastructure, WEF (1=extremely underdeveloped to 7=well developed and efficient by international standards)', 'Country', '', '', 'Quality of Port Infrastructure measures business executives'' perceptions of their country''s port facilities. The rating ranges from 1 to 7, with a higher score indicating better development of port infrastructure.', 'Annual', '', 'Unweighted average'),
(617, 'IS.AIR.DPRT', 'Air transport, registered carrier departures worldwide', 'Country', '', '', 'Registered carrier departures worldwide are domestic takeoffs and takeoffs abroad of air carriers registered in the country.', 'Annual', '', 'Sum'),
(618, 'IS.AIR.GOOD.MT.K1', 'Air transport, freight (million tonkm)', 'Country', '', '', 'Air freight is the volume of freight, express, and diplomatic bags carried on each flight stage (operation of an aircraft from takeoff to its next landing), measured in metric tons times kilometers traveled.', 'Annual', '', 'Sum'),
(619, 'IS.AIR.PSGR', 'Air transport, passengers carried', 'Country', '', '', 'Air passengers carried include both domestic and international aircraft passengers of air carriers registered in the country.', 'Annual', '', 'Sum'),
(620, 'IS.ROD.DESL.KT', 'Road sector diesel fuel consumption (kt of oil equivalent)', 'Country', '', '', 'Diesel is heavy oils used as a fuel for internal combustion in diesel engines.', 'Annual', '', ''),
(621, 'IS.ROD.DESL.PC', 'Road sector diesel fuel consumption per capita (kg of oil equivalent)', 'Country', '', '', 'Diesel is heavy oils used as a fuel for internal combustion in diesel engines.', 'Annual', '', 'Weighted average'),
(622, 'IS.ROD.DNST.K2', 'Road density (km of road per 100 sq. km of land area)', 'Country', '', '', 'Road density is the ratio of the length of the country''s total road network to the country''s land area. The road network includes all roads in the country: motorways, highways, main or national roads, secondary or regional roads, and other urban and rural', 'Annual', '', 'Weighted average'),
(623, 'IS.ROD.ENGY.KT', 'Road sector energy consumption (kt of oil equivalent)', 'Country', '', '', 'Road sector energy consumption is the total energy used in the road sector including petroleum products, natural gas, electricity, and combustible renewable and waste.', 'Annual', '', ''),
(624, 'IS.ROD.ENGY.PC', 'Road sector energy consumption per capita (kg of oil equivalent)', 'Country', '', '', 'Road sector energy consumption is the total energy used in the road sector including petroleum products, natural gas, electricity, and combustible renewable and waste.', 'Annual', '', 'Weighted average'),
(625, 'IS.ROD.ENGY.ZS', 'Road sector energy consumption (% of total energy consumption)', 'Country', '', '', 'Road sector energy consumption is the total energy used in the road sector including petroleum products, natural gas, electricity, and combustible renewable and waste. Total energy consumption is the total country energy consumption.', 'Annual', '', 'Weighted average'),
(626, 'IS.ROD.GOOD.MT.K6', 'Roads, goods transported (million tonkm)', 'Country', '', '', 'Goods transported by road are the volume of goods transported by road vehicles, measured in millions of metric tons times kilometers traveled.', 'Annual', '', 'Median'),
(627, 'IS.ROD.PAVE.ZS', 'Roads, paved (% of total roads)', 'Country', '', '', 'Paved roads are those surfaced with crushed stone (macadam) and hydrocarbon binder or bituminized agents, with concrete, or with cobblestones, as a percentage of all the country''s roads, measured in length.', 'Annual', '', 'Median'),
(628, 'IS.ROD.PSGR.K6', 'Roads, passengers carried (million passengerkm)', 'Country', '', '', 'Passengers carried by road are the number of passengers transported by road times kilometers traveled.', 'Annual', '', 'Median'),
(629, 'IS.ROD.SGAS.KT', 'Road sector gasoline fuel consumption (kt of oil equivalent)', 'Country', '', '', 'Gasoline is light hydrocarbon oil use in internal combustion engine such as motor vehicles, excluding aircraft.', 'Annual', '', ''),
(630, 'IS.ROD.SGAS.PC', 'Road sector gasoline fuel consumption per capita (kg of oil equivalent)', 'Country', '', '', 'Gasoline is light hydrocarbon oil use in internal combustion engine such as motor vehicles, excluding aircraft.', 'Annual', '', 'Weighted average'),
(631, 'IS.ROD.TOTL.KM', 'Roads, total network (km)', 'Country', '', '', 'Total road network includes motorways, highways, and main or national roads, secondary or regional roads, and all other roads in a country.', 'Annual', '', ''),
(632, 'IS.RRS.GOOD.MT.K6', 'Railways, goods transported (million tonkm)', 'Country', '', '', 'Goods transported by railway are the volume of goods transported by railway, measured in metric tons times kilometers traveled.', 'Annual', '', 'Median'),
(633, 'IS.RRS.PASG.KM', 'Railways, passengers carried (million passengerkm)', 'Country', '', '', 'Passengers carried by railway are the number of passengers transported by rail times kilometers traveled.', 'Annual', '', 'Median'),
(634, 'IS.RRS.TOTL.KM', 'Rail lines (total routekm)', 'Country', '', '', 'Rail lines are the length of railway route available for train service, irrespective of the number of parallel tracks.', 'Annual', '', 'Sum'),
