(637, 'IS.VEH.NVEH.P3', 'Motor vehicles (per 1,000 people)', 'Country', '', '', 'Motor vehicles include cars, buses, and freight vehicles but do not include twowheelers. Population refers to midyear population in the year for which data are available.', 'Annual', '', 'Weighted average'),
(638, 'IS.VEH.PCAR.P3', 'Passenger cars (per 1,000 people)', 'Country', '', '', 'Passenger cars refer to road motor vehicles, other than twowheelers, intended for the carriage of passengers and designed to seat no more than nine people (including the driver).', 'Annual', '', 'Weighted average'),
