(640, 'IT.CEL.SETS', 'Mobile cellular subscriptions', 'Country', '', '', 'Mobile cellular telephone subscriptions are subscriptions to a public mobile telephone service using cellular technology, which provide access to the public switched telephone network. Postpaid and prepaid subscriptions are included.', 'Annual', '', 'Sum'),
(641, 'IT.CEL.SETS.P2', 'Mobile cellular subscriptions (per 100 people)', 'Country', '', '', 'Mobile cellular telephone subscriptions are subscriptions to a public mobile telephone service using cellular technology, which provide access to the public switched telephone network. Postpaid and prepaid subscriptions are included.', 'Annual', '', 'Weighted average'),
