(650, 'LP.EXP.DURS.MD', 'Lead time to export, median case (days)', 'Country', '', '', 'Lead time to export is the median time (the value for 50 percent of shipments) from shipment point to port of loading.', 'Annual', '', 'Unweighted average'),
