(652, 'LP.LPI.CUST.XQ', 'Logistics performance index: Efficiency of customs clearance process (1=low to 5=high)', 'Country', '', '', 'Logistics professionals'' perception of the efficiency of country''s customs clearance processes (i.e. speed, simplicity and predictability of formalities), on a rating ranging from 1 (very low) to 5 (very high). Scores are averaged across all respondents.', 'Annual', '', 'Unweighted average'),
