(654, 'LP.LPI.ITRN.XQ', 'Logistics performance index: Ease of arranging competitively priced shipments (1=low to 5=high)', 'Country', '', '', 'Logistics professionals'' perception of the ease of arranging competitively priced shipments to a country, on a rating ranging from 1 (very difficult) to 5 (very easy). Scores are averaged across all respondents.', 'Annual', '', 'Unweighted average'),
