(1139, 'SP.DYN.CONU.ZS', 'Contraceptive prevalence (% of women ages 1549)', 'Country', '', '', 'Contraceptive prevalence rate is the percentage of women who are practicing, or whose sexual partners are practicing, any form of contraception. It is usually measured for married women ages 1549 only.', 'Annual', '', 'Weighted average'),
