(1141, 'SP.DYN.LE00.FE.IN', 'Life expectancy at birth, female (years)', 'Country', '', '', 'Life expectancy at birth indicates the number of years a newborn infant would live if prevailing patterns of mortality at the time of its birth were to stay the same throughout its life.', 'Annual', '', 'Weighted average'),
