(1144, 'SP.DYN.TFRT.IN', 'Fertility rate, total (births per woman)', 'Country', '', '', 'Total fertility rate represents the number of children that would be born to a woman if she were to live to the end of her childbearing years and bear children in accordance with current agespecific fertility rates.', 'Annual', '', 'Weighted average'),
(1145, 'SP.DYN.TO65.FE.ZS', 'Survival to age 65, female (% of cohort)', 'Country', '', '', 'Survival to age 65 refers to the percentage of a cohort of newborn infants that would survive to age 65, if subject to current age specific mortality rates.', 'Annual', '', 'Weighted average'),
