(1147, 'SP.DYN.WFRT', 'Wanted fertility rate (births per woman)', 'Country', '', '', 'Wanted fertility rate is an estimate of what the total fertility rate would be if all unwanted births were avoided.', 'Annual', '', 'Weighted average'),
