(1150, 'SP.POP.0014.TO.ZS', 'Population ages 014 (% of total)', 'Country', '', '', 'Population between the ages 0 to 14 as a percentage of the total population. Population is based on the de facto definition of population.', 'Annual', '', 'Weighted average'),
