(1157, 'SP.POP.SCIE.RD.P6', 'Researchers in R&D (per million people)', 'Country', '', '', 'Researchers in R&D are professionals engaged in the conception or creation of new knowledge, products, processes, methods, or systems and in the management of the projects concerned. Postgraduate PhD students (ISCED97 level 6) engaged in R&D are included.', 'Annual', '', 'Weighted average'),
(1158, 'SP.POP.TECH.RD.P6', 'Technicians in R&D (per million people)', 'Country', '', '', 'Technicians in R&D and equivalent staff are people whose main tasks require technical knowledge and experience in engineering, physical and life sciences (technicians), or social sciences and humanities (equivalent staff). They participate in R&D by perfo', 'Annual', '', 'Weighted average'),
(1159, 'SP.POP.TOTL', 'Population, total', 'Country', '', '', 'Total population is based on the de facto definition of population, which counts all residents regardless of legal status or citizenshipexcept for refugees not permanently settled in the country of asylum, who are generally considered part of the populati', 'Annual', '', 'Sum'),
