(1161, 'SP.REG.BRTH.RU.ZS', 'Completeness of birth registration, rural (%)', 'Country', '', '', 'Completeness of birth registration is the percentage of children under age 5 whose births were registered at the time of the survey. The numerator of completeness of birth registration includes children whose birth certificate was seen by the interviewer ', 'Annual', '', ''),
(1162, 'SP.REG.BRTH.UR.ZS', 'Completeness of birth registration, urban (%)', 'Country', '', '', 'Completeness of birth registration is the percentage of children under age 5 whose births were registered at the time of the survey. The numerator of completeness of birth registration includes children whose birth certificate was seen by the interviewer ', 'Annual', '', ''),
