(1164, 'SP.RUR.TOTL', 'Rural population', 'Country', '', '', 'Rural population refers to people living in rural areas as defined by national statistical offices. It is calculated as the difference between total population and urban population. Aggregation of urban and rural population may not add up to total populat', 'Annual', '', 'Sum');
