(1173, 'ST.INT.RCPT.CD', 'International tourism, receipts (current US$)', 'Country', '', '', 'International tourism receipts are expenditures by international inbound visitors, including payments to national carriers for international transport. These receipts include any other prepayment made for goods or services received in the destination coun', 'Annual', '', 'Gapfilled total'),
