(1177, 'ST.INT.TVLR.CD', 'International tourism, receipts for travel items (current US$)', 'Country', '', '', 'International tourism receipts for travel items are expenditures by international inbound visitors in the reporting economy. The goods and services are purchased by, or on behalf of, the traveler or provided, without a quid pro quo, for the traveler to us', 'Annual', '', 'Gapfilled total'),
(1178, 'ST.INT.TVLX.CD', 'International tourism, expenditures for travel items (current US$)', 'Country', '', '', 'International tourism expenditures are expenditures of international outbound visitors in other countries. The goods and services are purchased by, or on behalf of, the traveler or provided, without a quid pro quo, for the traveler to use or give away. Th', 'Annual', '', 'Gapfilled total'),
(1179, 'ST.INT.XPND.CD', 'International tourism, expenditures (current US$)', 'Country', '', '', 'International tourism expenditures are expenditures of international outbound visitors in other countries, including payments to foreign carriers for international transport. These expenditures may include those by residents traveling abroad as sameday vi', 'Annual', '', 'Gapfilled total'),
