(1181, 'TG.VAL.TOTL.GD.ZS', 'Merchandise trade (% of GDP)', 'Country', '', '', 'Merchandise trade as a share of GDP is the sum of merchandise exports and imports divided by the value of GDP, all in current U.S. dollars.', 'Annual', '', 'Weighted average'),
(1182, 'TM.QTY.MRCH.XD.WD', 'Import volume index (2000 = 100)', 'Country', '', '2000', 'Import volume indexes are derived from UNCTAD''s volume index series and are the ratio of the import value indexes to the corresponding unit value indexes. Unit value indexes are based on data reported by countries that demonstrate consistency under UNCTAD', 'Annual', '', ''),
(1183, 'TM.TAX.MANF.BC.ZS', 'Binding coverage, manufactured products (%)', 'Country', '', '', 'Binding coverage is the percentage of product lines with an agreed bound rate. Manufactured products are commodities classified in SITC revision 3 sections 58 excluding division 68.', 'Annual', '', ''),
(1184, 'TM.TAX.MANF.BR.ZS', 'Bound rate, simple mean, manufactured products (%)', 'Country', '', '', 'Simple mean bound rate is the unweighted average of all the lines in the tariff schedule in which bound rates have been set. Manufactured products are commodities classified in SITC revision 3 sections 58 excluding division 68.', 'Annual', '', ''),
(1185, 'TM.TAX.MANF.IP.ZS', 'Share of tariff lines with international peaks, manufactured products (%)', 'Country', '', '', 'Share of tariff lines with international peaks is the share of lines in the tariff schedule with tariff rates that exceed 15 percent. Manufactured products are commodities classified in SITC revision 3 sections 58 excluding division 68.', 'Annual', '', ''),
(1186, 'TM.TAX.MANF.SM.AR.ZS', 'Tariff rate, applied, simple mean, manufactured products (%)', 'Country', '', '', 'Simple mean applied tariff is the unweighted average of effectively applied rates for all products subject to tariffs calculated for all traded goods. Manufactured products are commodities classified in SITC revision 3 sections 58 excluding division 68.', 'Annual', '', ''),
(1187, 'TM.TAX.MANF.SM.FN.ZS', 'Tariff rate, most favored nation, simple mean, manufactured products (%)', 'Country', '', '', 'Simple mean most favored nation tariff rate is the unweighted average of most favored nation rates for all products subject to tariffs calculated for all traded goods. Manufactured products are commodities classified in SITC revision 3 sections 58 excludi', 'Annual', '', ''),
(1188, 'TM.TAX.MANF.SR.ZS', 'Share of tariff lines with specific rates, manufactured products (%)', 'Country', '', '', 'Share of tariff lines with specific rates is the share of lines in the tariff schedule that are set on a per unit basis or that combine ad valorem and per unit rates. Manufactured products are commodities classified in SITC revision 3 sections 58 excludin', 'Annual', '', ''),
(1189, 'TM.TAX.MANF.WM.AR.ZS', 'Tariff rate, applied, weighted mean, manufactured products (%)', 'Country', '', '', 'Weighted mean applied tariff is the average of effectively applied rates weighted by the product import shares corresponding to each partner country. Manufactured products are commodities classified in SITC revision 3 sections 58 excluding division 68.', 'Annual', '', ''),
(1190, 'TM.TAX.MANF.WM.FN.ZS', 'Tariff rate, most favored nation, weighted mean, manufactured products (%)', 'Country', '', '', 'Weighted mean most favored nations tariff is the average of most favored nation rates weighted by the product import shares corresponding to each partner country. Manufactured products are commodities classified in SITC revision 3 sections 58 excluding di', 'Annual', '', ''),
(1191, 'TM.TAX.MRCH.BC.ZS', 'Binding coverage, all products (%)', 'Country', '', '', 'Binding coverage is the percentage of product lines with an agreed bound rate. ', 'Annual', '', ''),
(1192, 'TM.TAX.MRCH.BR.ZS', 'Bound rate, simple mean, all products (%)', 'Country', '', '', 'Simple mean bound rate is the unweighted average of all the lines in the tariff schedule in which bound rates have been set.', 'Annual', '', ''),
(1193, 'TM.TAX.MRCH.IP.ZS', 'Share of tariff lines with international peaks, all products (%)', 'Country', '', '', 'Share of tariff lines with international peaks is the share of lines in the tariff schedule with tariff rates that exceed 15 percent.', 'Annual', '', ''),
(1194, 'TM.TAX.MRCH.SM.AR.ZS', 'Tariff rate, applied, simple mean, all products (%)', 'Country', '', '', 'Simple mean applied tariff is the unweighted average of effectively applied rates for all products subject to tariffs calculated for all traded goods.', 'Annual', '', ''),
